function isObject(a){return null!==a&&("function"==typeof a||"object"==typeof a)}function isDate(a){switch(typeof a){case"number":return!0;case"string":return!isNaN(Date.parse(a));case"object":if(a instanceof Date)return!isNaN(a.getTime());default:return!1}}function isEmptyOrOnlySpacesString(a){return!a||/^\s*$/.test(a)}function getTimeZone(){return Intl.DateTimeFormat().resolvedOptions().timeZone}function doesObjectHasEmptyProperties(a){let b=[];for(let c in a)""===a[c]&&b.push(c+" is empty.\n");return b.join("")+" others keys are filled"}function isSorted(a){return a.every((b,a,c)=>!a||c[a-1]<=b)}function shuffleArray(a){let b=a.length;for(;b;){let c=Math.floor(Math.random()*b--);[a[b],a[c]]=[a[c],a[b]]}return a}module.exports={isObject,isDate,isEmptyOrOnlySpacesString,getTimeZone,doesObjectHasEmptyProperties,isSorted,shuffleArray}